import React, { useState } from 'react';
import axios from 'axios';

const StudentRegister = () => {
  const [formData, setFormData] = useState({
    name: '',
    rollNumber: '',
    dob: '',
    registerNumber: '',
    branch: '',
    yearOfEntry: '',
    fatherName: '',
    fatherOccupation: '',
    educationOccupation: '',
    familyBackground: '',
    parentPhoneNo: '',
    address: '',
    languagesKnown: '',
    guardianName: '',
    lastSchoolName: '',
    mediumOfInstructions: '',
    marksInPlusTwo: {
      maths: '',
      physics: '',
      chemistry: '',
      cutOff: '',
      quota: ''
    },
    counselorNames: {
      firstYear: '',
      secondYear: '',
      thirdYear: '',
      finalYear: ''
    }
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    try {
      const response = await axios.post('http://localhost:5000/api/students/register', formData);
      console.log('Registration successful:', response.data);
      alert('Student registered successfully');
    } catch (err) {
      console.error('Error registering student:', err);
      alert('Error occurred while registering');
    }
  };

  return (
    <div className="container">
      <h2>Student Registration</h2>
      <form onSubmit={handleSubmit}>
        {/* Add input fields for the student registration form */}
        <input
          type="text"
          name="name"
          value={formData.name}
          onChange={handleChange}
          placeholder="Name"
          required
        />
        <input
          type="text"
          name="rollNumber"
          value={formData.rollNumber}
          onChange={handleChange}
          placeholder="Roll Number"
          required
        />
        <input
          type="date"
          name="dob"
          value={formData.dob}
          onChange={handleChange}
          required
        />
        <input
          type="text"
          name="registerNumber"
          value={formData.registerNumber}
          onChange={handleChange}
          placeholder="Register Number"
          required
        />
        <input
          type="text"
          name="branch"
          value={formData.branch}
          onChange={handleChange}
          placeholder="Branch"
          required
        />
        {/* Additional fields */}
        <input
          type="text"
          name="fatherName"
          value={formData.fatherName}
          onChange={handleChange}
          placeholder="Father's Name"
          required
        />
        <input
          type="text"
          name="fatherOccupation"
          value={formData.fatherOccupation}
          onChange={handleChange}
          placeholder="Father's Occupation"
          required
        />
        <input
          type="text"
          name="educationOccupation"
          value={formData.educationOccupation}
          onChange={handleChange}
          placeholder="Your Education Occupation"
          required
        />
        <input
          type="text"
          name="familyBackground"
          value={formData.familyBackground}
          onChange={handleChange}
          placeholder="Family Background"
          required
        />
        <input
          type="text"
          name="parentPhoneNo"
          value={formData.parentPhoneNo}
          onChange={handleChange}
          placeholder="Parent Phone Number"
          required
        />
        <input
          type="text"
          name="address"
          value={formData.address}
          onChange={handleChange}
          placeholder="Address"
          required
        />
        <input
          type="text"
          name="languagesKnown"
          value={formData.languagesKnown}
          onChange={handleChange}
          placeholder="Languages Known"
          required
        />
        <input
                        type="text"
                        placeholder="Guardian's Name (if any)"
                        name="guardianName"
                        value={formData.guardianName}
                        onChange={handleChange}
                        className="register-input"
                    />
                    <input
                        type="text"
                        placeholder="School Last Studied"
                        name="schoolName"
                        value={formData.schoolName}
                        onChange={handleChange}
                        className="register-input"
                    />
                    <input
                        type="text"
                        placeholder="Medium of Instructions in +2"
                        name="mediumOfInstruction"
                        value={formData.mediumOfInstruction}
                        onChange={handleChange}
                        className="register-input"
                    />
                    <input
                        type="text"
                        placeholder="Marks in +2 - Maths"
                        name="marksMaths"
                        value={formData.marksMaths}
                        onChange={handleChange}
                        className="register-input"
                    />
                    <input
                        type="text"
                        placeholder="Marks in +2 - Physics"
                        name="marksPhysics"
                        value={formData.marksPhysics}
                        onChange={handleChange}
                        className="register-input"
                    />
                    <input
                        type="text"
                        placeholder="Marks in +2 - Chemistry"
                        name="marksChemistry"
                        value={formData.marksChemistry}
                        onChange={handleChange}
                        className="register-input"
                    />
                    <input
                        type="text"
                        placeholder="Cut Off"
                        name="cutOff"
                        value={formData.cutOff}
                        onChange={handleChange}
                        className="register-input"
                    />
                    <input
                        type="text"
                        placeholder="Quota"
                        name="quota"
                        value={formData.quota}
                        onChange={handleChange}
                        className="register-input"
                    />
                    <input
                        type="text"
                        placeholder="Counselor's Name (1st Year)"
                        name="counsellorNames[0]"
                        value={formData.counsellorNames[0]}
                        onChange={handleChange}
                        className="register-input"
                    />
                    <input
                        type="text"
                        placeholder="Counselor's Name (2nd Year)"
                        name="counsellorNames[1]"
                        value={formData.counsellorNames[1]}
                        onChange={handleChange}
                        className="register-input"
                    />
                    <input
                        type="text"
                        placeholder="Counselor's Name (3rd Year)"
                        name="counsellorNames[2]"
                        value={formData.counsellorNames[2]}
                        onChange={handleChange}
                        className="register-input"
                    />
                    <input
                        type="text"
                        placeholder="Counselor's Name (Final Year)"
                        name="counsellorNames[3]"
                        value={formData.counsellorNames[3]}
                        onChange={handleChange}
                        className="register-input"
                    />
        <button type="submit">Register</button>
      </form>
    </div>
  );
};

export default StudentRegister;
